import React, { Component } from 'react';
import Card from './Card';

class Cards extends Component {
  render() {
    return(
      <div>
        { this.props.cards.map(card => <Card name={card.name} handle={card.handle} location={card.location} following={card.following} followers={card.followers} repos={card.repos} />)}
      </div>
    );
  }
}

export default Cards;
